import React from 'react';
import Room from './Room';

function RoomsList({rooms}){
  if(rooms.length===0){
    return (<div className="empty-search">
     <h3>Unfortunatly no room matched your search</h3>
    </div>);
  }
  return(
   <div>
     <h1>Rooms Listing!</h1>
   </div>
  );
}

export default RoomsList;
